日用品／家庭用品／ペーパー類(紙用品)<br>ネピア アンパンマン 鼻セレブティシュ 180組×3個パック<br>やわらか特別仕様の保湿ティッシュ(ローションティッシュ)です。<br>おとなにも、かわいい。こどもにも、やさしい。<br>アンパンマンの鼻セレブは、やわらかさにこだわった、ふんわり厚手の特別仕様です。<br>ダブル保湿に加え、うるおい成分天然スクワランと、ベビーオイルを配合。<br>おとなの鼻にはもちろん、デリケートなおこさまの鼻にも、やさしい使い心地です。<br><br>cやなせたかし/フレーベル館・TMS・NTV <br><br> 使用上の注意<br>●取り出し口のミシン目で指を傷つけることがありますのでご注意ください。<br>●直射日光のあたる場所や、高温の車内では、保湿効果が低下することがありますので、長時間置かないでください。<br>●このティッシュペーパーは水に溶けにくいので、水洗トイレでは使用したり捨てたりしないでください。<br>●引火をさけるため、火のそばにはおかないでください。<br>●万一、お肌に合わない場合はご使用をおやめください。<br>●乳幼児の手の届かない所に保管してください。<br>●ティッシュを口に入れたり、飲み込まないようにご注意ください。窒息などの危険があります。  <br><br> 原産国：日本<br><br> お問い合わせ先：<br>王子ネピア株式会社ネピア<br>お客様相談室：03-3248-2769<br>受付時間9：30-17：00(土日祝日を除く)  <br><br>販売_製造元： 王子ネピア<br>ブランド：ネピア鼻セレブ<br>JAN：4901121626505<br><br>CS：10<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
